import React from "react";

//Components
import { Header } from "./components/header";
import { MainPresentation } from "./components/mainPresentation";
import { MainIcons } from "./components/mainIcons";


// Style
import settings from './styles/settings.css'

function App() {
  return (
    <React.Fragment>

      <header>

        <Header />

      </header>

      <main>



        <section className = 'main-presentation'>

          <MainPresentation />

        </section>

        <section className='main-icons'>

          <MainIcons />

        </section>

      </main>

    </React.Fragment>
  );
}

export default App;
